window.bookSummaryJSON = "<p><b>Jack Noble found freedom from the CIA. A rogue assassin doesn’t care.</b></p> <p>When Jack Noble is sent to Brugge, Belgium to wait for further instruction, he finds himself at battle with a group of thugs harassing local businesses. But they aren't his only problem....</p> <p>A rogue assassin who had Noble in his sights once before and missed is determined to finish the job, no matter the consequences.</p> <p>With new allies by his side, Noble is locked in a life or death battle with one of the deadliest assassins in Europe, and they'll be lucky if only one of them makes it out alive.</p>"; 
